import React, { Component } from "react";

class PERSONAS extends Component {
  state = {
    verP: false,
  };

  mostrarP = () => {
    this.setState({
      verP: !this.state.verP
    });
  };
  render() {
    const { personas } = this.props;
    return (
      <div>
        {this.state.verP === true ? (
          <ul>
            {personas.map((el) => (
              <li key={el.cedula}>{el.nombre}</li>
            ))}
          </ul>
        ) : null}
      </div>
    );
  }
}

export default PERSONAS;
